काठमाडौं । एनएमबि बैंकले २६औँ वार्षिक साधारण सभा सम्पन्न गरेको छ । बैंकले&nbsp; बिहीबार सम्पन्न गरेको साधारणसभाबाट सञ्चालक समितिले प्रस्ताव गरेको लाभांश पारित गरेको छ ।

बैंकका अध्यक्ष पवन कुमार गोल्याणको अध्यक्षतामा &nbsp;सम्पन्न सभाले आर्थिक वर्ष २०७७/०७८ को नाफाबाट हाल कायम चुक्त पूजीको १२.५० प्रतिशत बोनस सेयर र ३.३ प्रतिशत नगद...

हलिउड । पाराअमाउन्ट प्लस सिरिज &lsquo;स्टार ट्रेकः पिकार्ड&rsquo; को छायांकन स्थगित भएको छ । निर्माण&nbsp;टिमका ५० जना भन्दा बढीमा कोरोना संक्रमण देखिएपछि निर्माण स्थगित गरिएको हो ।

क्रिसमसपछि सोमबार मात्रै छायांकन पुनः सुरु गरिएको थियो । तर, पहिलो दिनमै यतिधेरै सदस्यमा कोरोना देखिएपछि निर्माण टिम छायांकन&nbsp;स्थगित गर्न बाध्य भएको हो ।&nbsp;

