&nbsp;
चलचित्रमा कोसिस क्षेत्री नायकका रुपमा देखिने छन् । डार्क थ्रिलर चलचित्रको नायिका अडिसनमार्फत लिइने निर्मात्रा सर्मिला पाण्डेले जानकारी दिइन् ।&nbsp;

